(406, 'tt0206634', 'Children of Men', 2006, 'In 2027, in a chaotic world in which women have become somehow infertile, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea.', 7.9, 377983, 109, '2VT2apoX90o', '2017-03-12 14:44:51', '2017-03-12 14:44:51'),
(407, 'tt0047573', 'Them!', 1954, 'The earliest atomic tests in New Mexico cause common ants to mutate into giant man-eating monsters that threaten civilization.', 7.3, 15512, 94, 'v4URRp39XOo', '2017-03-12 14:44:54', '2017-03-12 14:44:54'),
(408, 'tt0104691', 'The Last of the Mohicans', 1992, 'Three trappers protect a British Colonel\'s daughters in the midst of the French and Indian War.', 7.8, 118352, 112, 'yaQeVnN6pUc', '2017-03-12 14:44:55', '2017-03-12 14:44:55'),
(409, 'tt0417741', 'Harry Potter and the Half-Blood Prince', 2009, 'As Harry Potter begins his sixth year at Hogwarts, he discovers an old book marked as &quot;the property of the Half-Blood Prince&quot; and begins to learn more about Lord Voldemort\'s dark past.', 7.5, 345110, 153, 'sg81Lts5kYY', '2017-03-12 14:44:57', '2017-03-12 14:44:57'),
(410, 'tt0172493', 'Girl, Interrupted', 1999, 'Based on writer Susanna Kaysen\'s account of her 18-month stay at a mental hospital in the 1960s.', 7.3, 131166, 127, '5BHHUBZf7y4', '2017-03-12 14:44:59', '2017-03-12 14:44:59'),
(411, 'tt1013753', 'Milk', 2008, 'The story of Harvey Milk, and his struggles as an American gay activist who fought for gay rights and became California\'s first openly gay elected official.', 7.6, 141626, 128, 'Zp0uYT0zDbA', '2017-03-12 14:45:01', '2017-03-12 14:45:01'),
(412, 'tt0053604', 'The Apartment', 1960, 'A man tries to rise in his company by letting its executives use his apartment for trysts, but complications and a romance of his own ensue.', 8.3, 115993, 125, '9oU5PUTnClE', '2017-03-12 14:45:03', '2017-03-12 14:45:03'),
(413, 'tt4005402', 'The Colony', 2015, 'A young woman\'s desperate search for her abducted boyfriend that draws her into the infamous Colonia Dignidad, a sect nobody has ever escaped from.', 7.1, 27966, 106, 'SiVAGDTmlpY', '2017-03-12 14:45:05', '2017-03-12 14:45:05'),
(414, 'tt0783233', 'Atonement', 2007, 'Fledgling writer Briony Tallis, as a thirteen-year-old, irrevocably changes the course of several lives when she accuses her older sister\'s lover of a crime he did not commit.', 7.8, 200534, 123, 'zRlkHu-R7yI', '2017-03-12 14:45:07', '2017-03-12 14:45:07'),
(415, 'tt0405094', 'The Lives of Others', 2006, 'In 1984 East Berlin, an agent of the secret police, conducting surveillance on a writer and his lover, finds himself becoming increasingly absorbed by their lives.', 8.5, 273922, 137, 'FppW5ml4vdw', '2017-03-12 14:45:08', '2017-03-12 14:45:08'),
(416, 'tt0451279', 'Wonder Woman', 2017, 'Before she was Wonder Woman she was Diana, princess of the Amazons, trained warrior. When a pilot crashes and tells of conflict in the outside world, she leaves home to fight a war to end all wars, discovering her full powers and true destiny.', 8.1, 143831, 141, 'Tgk_63b-Mrw', '2017-06-25 15:01:27', '2017-06-25 15:01:27'),
(417, 'tt1790809', 'Pirates of the Caribbean: Dead Men Tell No Tales', 2017, 'Captain Jack Sparrow searches for the trident of Poseidon while being pursued by an undead sea captain and his crew.', 7.0, 74577, 129, 'Hgeu5rhoxxY', '2017-06-25 15:01:29', '2017-06-25 15:01:29'),
(418, 'tt2771200', 'Beauty and the Beast', 2017, 'An adaptation of the fairy tale about a monstrous-looking prince and a young woman who fall in love.', 7.5, 135679, 129, 'OvW_L8sTu5E', '2017-06-25 15:01:34', '2017-06-25 15:01:34'),
(419, 'tt3896198', 'Guardians of the Galaxy Vol. 2', 2017, 'The Guardians must fight to keep their newfound family together as they unravel the mystery of Peter Quill\'s true parentage.', 8.1, 173448, 136, '2cv2ueYnKjg', '2017-06-25 15:01:42', '2017-06-25 15:01:42'),
(420, 'tt4630562', 'The Fate of the Furious', 2017, 'When a mysterious woman seduces Dom into the world of terrorism and a betrayal of those closest to him, the crew face trials that will test them as never before.', 7.0, 96148, 136, 'J_k1yGJtHgw', '2017-06-25 15:01:47', '2017-06-25 15:01:47'),
(421, 'tt1972591', 'King Arthur: Legend of the Sword', 2017, 'Robbed of his birthright, Arthur comes up the hard way in the back alleys of the city. But once he pulls the sword from the stone, he is forced to acknowledge his true legacy - whether he likes it or not.', 7.3, 44945, 126, '4luDtkC3Oy0', '2017-06-25 15:01:51', '2017-06-25 15:01:51'),
(422, 'tt0120616', 'The Mummy', 1999, 'An American serving in the French Foreign Legion on an archaeological dig at the ancient city of Hamunaptra accidentally awakens a mummy.', 7.0, 335413, 125, 'h3ptPtxWJRs', '2017-06-25 15:01:55', '2017-06-25 15:01:55'),
(423, 'tt4481414', 'Gifted', 2017, 'Frank, a single man raising his child prodigy niece Mary, is drawn into a custody battle with his mother.', 7.7, 14262, 101, 'tI01wBXGHUs', '2017-06-25 15:01:58', '2017-06-25 15:01:58'),
(424, 'tt1959563', 'The Hitman\'s Bodyguard', 2017, 'The world\'s top bodyguard gets a new client, a hit man who must testify at the International Court of Justice. They must put their differences aside and work together to make it to the trial on time.', 7.1, 22318, 118, 'F4Afusxc2SM', '2017-08-31 05:08:26', '2017-08-31 05:08:26'),
(425, 'tt5140878', 'Annabelle: Creation', 2017, '12 years after the tragic death of their little girl, a dollmaker and his wife welcome a nun and several girls from a shuttered orphanage into their home, where they soon become the target of the dollmaker\'s possessed creation, Annabelle.', 7.0, 22556, 109, 'KisPhy7T__Q', '2017-08-31 05:08:32', '2017-08-31 05:08:32'),
(426, 'tt5013056', 'Dunkirk', 2017, 'Allied soldiers from Belgium, the British Empire and France are surrounded by the German army and evacuated during a fierce battle in World War II.', 8.4, 192467, 106, 'T7O7BtBnsG4', '2017-08-31 05:08:37', '2017-08-31 05:08:37'),
(427, 'tt2250912', 'Spider-Man: Homecoming', 2017, 'Peter Parker tries to balance his life as an ordinary high school student in Queens with his superhero alter-ego Spider-Man, and must confront a new menace prowling the skies of New York City.', 7.9, 148947, 133, 'oNE0zRNyXuc', '2017-08-31 05:08:39', '2017-08-31 05:08:39'),
(428, 'tt2406566', 'Atomic Blonde', 2017, 'An undercover MI6 agent is sent to Berlin during the Cold War to investigate the murder of a fellow agent and recover a missing list of double agents.', 7.1, 29924, 115, '8USk21Lt0f4', '2017-08-31 05:08:42', '2017-08-31 05:08:42'),
(429, 'tt3890160', 'Baby Driver', 2017, 'After being coerced into working for a crime boss, a young getaway driver finds himself taking part in a heist doomed to fail.', 8.1, 100196, 112, 'zTvJJnoWIPk', '2017-08-31 05:08:44', '2017-08-31 05:08:44'),
(430, 'tt3450958', 'War for the Planet of the Apes', 2017, 'After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind.', 7.9, 70067, 140, 'Y23E0OgEHuY', '2017-08-31 05:08:50', '2017-08-31 05:08:50'),
(431, 'tt4633690', 'Shot Caller', 2017, 'A newly released prison gangster is forced by the leaders of his gang to orchestrate a major crime with a brutal rival gang on the streets of Southern California.', 7.4, 17198, 121, 'QQxjyRr9k2E', '2017-08-31 05:08:52', '2017-08-31 05:08:52'),
(432, 'tt5462602', 'The Big Sick', 2017, 'Pakistan-born comedian Kumail Nanjiani and grad student Emily Gardner fall in love but struggle as their cultures clash. When Emily contracts a mysterious illness, Kumail finds himself forced to face her feisty parents, his family\'s expectations, and his true feelings.', 8.1, 13238, 120, 'MF14JJkOrSI', '2017-08-31 05:09:04', '2017-08-31 05:09:04'),
(433, 'tt2935476', 'Far from the Madding Crowd', 2015, 'In Victorian England, the independent and headstrong Bathsheba Everdene attracts three very different suitors: Gabriel Oak, a sheep farmer; Frank Troy, a reckless Sergeant; and William Boldwood, a prosperous and mature bachelor.', 7.1, 35723, 119, '5-_9AFwMDmQ', '2017-08-31 05:09:06', '2017-08-31 05:09:06'),
(434, 'tt1396484', 'Ça', 2017, 'A group of bullied kids band together when a shapeshifting demon, taking the appearance of clown, begins hunting children.', 8.1, 67297, 135, 'c-70KnXwvHU', '2017-09-16 10:36:55', '2017-09-16 10:36:55'),
(435, 'tt5439796', 'Logan Lucky', 2017, 'Two brothers attempt to pull off a heist during a NASCAR race in North Carolina.', 7.3, 15083, 118, 'EsQHkdMqD6g', '2017-09-16 10:36:59', '2017-09-16 10:36:59'),
(436, 'tt5362988', 'Wind River', 2017, 'A veteran tracker with the Fish and Wildlife Service helps to investigate the murder of a young Native American woman, and uses the case as a means of seeking redemption for an earlier act of irresponsibility which ended in tragedy.', 8.1, 12807, 107, 's7WuKdVhrmA', '2017-09-16 10:37:02', '2017-09-16 10:37:02'),
(437, 'tt3532216', 'American Made', 2017, 'A pilot lands work for the CIA and as a drug runner in the south during the 1980s.', 7.4, 11028, 115, 'AEBIJRAkujM', '2017-09-16 10:37:04', '2017-09-16 10:37:04'),
(438, 'tt0075860', 'Close Encounters of the Third Kind', 1977, 'Following an accidental encounter with otherworldly vessels, an ordinary man follows a series of psychic clues to the first scheduled meeting between representatives of Earth and visitors from the cosmos.', 7.7, 151589, 137, 'Fxp32VHaYdE', '2017-09-16 10:37:25', '2017-09-16 10:37:25'),
(439, 'tt4899370', 'Megan Leavey', 2017, 'Based on the true life story of a young Marine corporal whose unique discipline and bond with her military combat dog saved many lives during their deployment in Iraq.', 7.1, 5795, 116, '53TZCZ5KXWI', '2017-09-16 10:39:24', '2017-09-16 10:39:24'),
(448, 'tt1856101', 'Blade Runner 2049', 2017, 'A young blade runner\'s discovery of a long-buried secret leads him to track down former blade runner Rick Deckard, who\'s been missing for thirty years.', 8.5, 115490, 164, 'gCcx85zbxz4', '2017-10-23 07:33:37', '2017-10-23 07:33:37'),
(449, 'tt4649466', 'Kingsman: The Golden Circle', 2017, 'When their headquarters are destroyed and the world is held hostage, the Kingsman\'s journey leads them to the discovery of an allied spy organization in the US. These two elite secret organizations must band together to defeat a common enemy.', 7.2, 62661, 141, '6Nxc-3WpMbg', '2017-10-23 07:33:39', '2017-10-23 07:33:39'),
(450, 'tt1615160', 'The Foreigner', 2017, 'A humble businessman with a buried past seeks justice when his daughter is killed in an act of terrorism. A cat-and-mouse conflict ensues with a government official, whose past may hold clues to the killers\' identities.', 7.3, 5937, 114, 'om9YCk7ufHs', '2017-10-23 07:33:45', '2017-10-23 07:33:45'),
(451, 'tt5109784', 'Mother!', 2017, 'A couple\'s relationship is tested when uninvited guests arrive at their home, disrupting their tranquil existence.', 7.1, 38170, 121, 'XpICoc65uh0', '2017-10-23 07:33:47', '2017-10-23 07:33:47'),
(452, 'tt5536736', 'The Meyerowitz Stories (New and Selected)', 2017, 'An estranged family gathers together in New York for an event celebrating the artistic work of their father.', 7.2, 6604, 112, 'MYzFieit8dI', '2017-10-23 07:33:51', '2017-10-23 07:33:51'),
(453, 'tt6265828', 'A Ghost Story', 2017, 'In this singular exploration of legacy, love, loss, and the enormity of existence, a recently deceased, white-sheeted ghost returns to his suburban home to try to reconnect with his bereft wife.', 7.0, 14753, 92, 'FxLHP2IpBXw', '2017-10-23 07:33:55', '2017-10-23 07:33:55'),
(454, 'tt3783958', 'La La Land', 2016, 'While navigating their careers in Los Angeles, a pianist and an actress fall in love while attempting to reconcile their aspirations for the future.', 8.2, 314626, 128, '0pdqf4P9MB8', '2017-10-23 07:34:01', '2017-10-23 07:34:01');
